// SPDX-License-Identifier: MIT;
pragma solidity ^0.8.7;

contract CrowdfundingContract {
    uint No;
    struct Crowdfunding {
        uint num;           //项目编号
        uint status;        //状态 -1：失败；0：进行中 1：成功
        address creator;    //发起人
        address recipient;  //收款人
        uint joinNum;       //参与人数
        uint joinLimitNum;  //参与限制人数
        string expectAmout; //期望众筹金额
        string actualAmount;//实际众筹金额
    }

   Crowdfunding[] list;

    function createCrowdfunding(address _recipient,uint _joinLimitNum, string memory _expectAmout) public {
        No++;
        list.push(Crowdfunding({
            num: No,
            status: 0,
            creator: msg.sender,
            recipient: _recipient,
            joinNum: 0,
            joinLimitNum: _joinLimitNum,
            expectAmout: _expectAmout,
            actualAmount: '0'
        }));
    }

    function getAllCrowdfunding() public view returns (Crowdfunding[] memory){
        return list;
    }

}

